window.bookSummaryJSON = "<p><b>Fairytales are for the naive.</b></p> <p>Princess assassin Gray Monroe is ordered by her father to kill the villainous prince responsible for throwing the modern world into a post-apocalyptic society. In a decrepit landscape where two magical species war with one another while a human militia hunts them all, Gray has only one thing on her mind: vengeance.</p> <p>With a single focus on killing the man who murdered her first love, she believes nothing will stop her. That is until she hesitates when she comes face-to-face with her nemesis at long last.</p> <p>Gray must return to the King's Palace empty-handed for her annual birthday celebration to a court of vipers who lie in wait for a slip in her icy fa√ßade. When a sinister plot is revealed to assassinate the princess, she must flee into a world where she's now hunted and must survive to get the revenge she's owed.</p> <p>Prince Griffin Silas is on a mission of his own: to kill the King. The problem is he's suffering from an affliction that robs him of his sanity while making him crave violence and death. First, he needs the princess in his hands no matter the cost. In a race against his spiraling affliction, who will achieve their goal first?</p> <p><i>The first installment in the Celestials of Arcadia,</i> A Touch of Gold and Madness <i>is a dark romantic fantasy about moving through a lifetime of trauma.</i> <i>It's packed with action, secrets, betrayal, tension, and slow-burning steam. Discover the long-buried truths concealed by those who seek ultimate power. For mature listeners.</i></p>"; 
